    [parameter(Mandatory=$true)]
    [string]$AgentCertificate,

    [parameter(Mandatory=$true)]
    [string]$AgentKey,
    # [string]$TenantId,
    # [string]$SubscriptionId,
    # [string]$ResourceGroup,
    # [string]$VmType,
    # [string]$SubnetName,
    # [string]$MasterSubnet,
    # [string]$SecurityGroupName,
    # [string]$VNetName,
    # [string]$RouteTableName,
    # [string]$PrimaryAvailabilitySetName,
    # [string]$PrimaryScaleSetName,
    # [string]$KubeClusterCIDR,
    # [string]$KubeServiceCIDR,
    # [string]$VNetCIDR,

    [parameter(Mandatory=$true)]
    [string]$Location,

    [parameter(Mandatory=$true)]
    [string]$NodeIP
)

